import React from 'react';
import { Table } from 'react-bootstrap';


export default function TagTable(props) {
    console.log(props);
    const tags = props.tags;
    const tagsWrapped = tags.map((tag, i) => <td>{tag + i}</td>);

    return (
        <Table striped bordered>
            <thead>
                <tr>
                    <th>Tags</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    {tagsWrapped}
                </tr>
            </tbody>

        </Table>
    );
}
